import React, { Component } from 'react'
import { Nav, Navbar, Form, Button, FormControl } from 'react-bootstrap';
import '../styles/NavBar.css';


class NavBar extends Component {

  addSection() {
    if (this.props.username !== '') {
      return (
        <ul className="navbar-nav ml-auto">
          <li className="nav-item active">
            Welcome {this.props.username}
          </li>
        </ul>
      );
    }
    else {
      return (
        <ul className="navbar-nav ml-auto">
          <Nav className="link" to="/">
            Login
            </Nav>
          <Nav className="link" to="/register">
            Register
          </Nav>
        </ul>
      );
    }
  }
  render() {
    return (
      <Navbar className="navbar navbar-expand-lg navbar-light bg-light navbar-dark bg-custom" bg="light" expand="lg">
        <Navbar.Brand href="#home">LOGO</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link className="link" to="/">
              Home
            </Nav.Link>
          </Nav>
           <Form inline style={{width: '50%'}}>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" style={{width:'75%'}}/>
            <Button variant="outline-success">Search</Button>
          </Form> 
            {this.addSection()}
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default NavBar;
